import React, { useEffect, useState } from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import TablePagination from "@mui/material/TablePagination";
import SearchBar from "material-ui-search-bar";

interface Row {
  name: string;
  calories: number;
  fat: number;
  carbs: number;
  protein: number;
}

export function BasicTable() {
  const [rows, setRows] = useState<Row[]>([]);
  //   const [page, setPage] = useState(0);
  //   const [rowsPerPage, setRowsPerPage] = useState(5);
  const [collector, setCollector] = useState<any>({
    page: 0,
    rowsPerPage: 5,
  });
  const [searchQuery, setSearchQuery] = useState<string>("");
  //   const [displayedRows, setNewRows] = useState<Row[]>([]);

  useEffect(() => {
    useEffect(() => {
      const getData = async () => {
        const url = `https://api.instantwebtools.net/v1/passenger?page=${controller.page}&size=${controller.rowsPerPage}`;
        try {
          const response = await fetch(url);
          if (response.statusText === "OK") {
            const data = await response.json();
            console.log(data);
            setPassengersList(data.data);
            setPassengersCount(data.totalPassengers);
          } else {
            throw new Error("Request failed");
          }
        } catch (error) {
          console.log(error);
        }
      };
      getData();
    }, [controller]);
  }, []);

  //   const handleChangePage = (event: unknown, newPage: number) => {
  //     setPage(newPage);
  //   };

  //   const handleChangeRowsPerPage = (
  //     event: React.ChangeEvent<HTMLInputElement>
  //   ) => {
  //     setRowsPerPage(parseInt(event.target.value, 10));
  //     setPage(0);
  //   };

  const handleSearch = (searchedVal: string) => {
    setSearchQuery(searchedVal);
    const filteredRows = rows.filter((row) =>
      row.name.toLowerCase().includes(searchedVal.toLowerCase())
    );
    setNewRows(filteredRows);
  };

  //   const startIndex = page * rowsPerPage;
  //   const endIndex = startIndex + rowsPerPage;
  //   const emptyRows = rowsPerPage - displayedRows.length;
  const handlePageChange = (event, newPage) => {
    setController({
      ...controller,
      page: newPage,
    });
  };

  const handleChangeRowsPerPage = (event) => {
    setController({
      ...controller,
      rowsPerPage: parseInt(event.target.value, 10),
      page: 0,
    });
  };
  return (
    <Paper>
      <SearchBar value={searchQuery} onChange={handleSearch} />
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Name</TableCell>
            <TableCell>Trips</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {passengersList.map((passenger) => (
            <TableRow key={passenger._id}>
              <TableCell>{passenger.name}</TableCell>
              <TableCell>{passenger.trips}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      <TablePagination
        component="div"
        onPageChange={handlePageChange}
        page={controller.page}
        count={passengersCount}
        rowsPerPage={controller.rowsPerPage}
        onRowsPerPageChange={handleChangeRowsPerPage}
      />
    </Paper>
  );
}
